import React from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";

function Login() {
  return (
    <div>
      <h1>hello</h1>
    </div>
  );
}

export default function index() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" exact component={Login}></Route>
      </Switch>
    </BrowserRouter>
  );
}
